import React from 'react';
import './directory-header.style.css'


const DirectoryHeader = () => (
    <div className='DirectoryHeader_container'>
        <div className='DirectoryHeader_content'>
            <p className='DirectoryHeader_text'> WE INNOVATES EFFECTIVE FORMULAS TO</p>
            <p className='DirectoryHeader_text'> DELIVER RESULTS FOR YOUR CONCERNS. </p>
            <div className='DirectoryHeader_CTA_container'>
                <span className='DirectoryHeader_CTA'>Shop by Collections</span>
            </div>
        </div>
    </div>
);

export default DirectoryHeader;
